import React from "react";
import {Routes, Route} from "react-router-dom";
import Home from "./Pages/Home";


import logo from './logo.svg';
import './App.css';

function App() {
  return (
   <Routes>
      <Route path="/o" element={<Home />}/> 
   </Routes>
  );
}

export default App;
